import React, { Component } from "react";
import arrow from "../img/arrow.png";

class Arrow extends Component {
  render() {
    return (
      <div
        className="HomeImagesCenter"
        onClick={() => {
          this.props.handleClick();
        }}
      >
        <img className="arrow" src={arrow} />
      </div>
    );
  }
}

export default Arrow;
